// SPDX-License-Identifier: MIT

/**
    @title SmartCOOP 
    @notice COOP token is based on the OpenZeppelin ERC-20 token standard as defined at ->
            https://github.com/OpenZeppelin/openzeppelin-contracts/tree/master/contracts/token/ERC20

            Ownable is definied on following OpenZeppelin address ->
            https://github.com/OpenZeppelin/openzeppelin-contracts/blob/master/contracts/access/
 */

pragma solidity 0.8.0;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/Pausable.sol";
import "@chainlink/contracts/src/v0.8/interfaces/AggregatorV3Interface.sol";

pragma solidity 0.8.0;

contract SmartCOOP is Pausable, Ownable {
    /* State variables
     */

    ERC20 private coopToken;
    AggregatorV3Interface internal priceFeed;

    uint256 public raspberryPrice = 9;
    address[] public members;
    address[] public warehouseStock;

    struct Cooperant {
        uint256 feePayed;
        uint256 kg;
    }

    mapping(address => Cooperant) public cooperants;

    constructor(address contractAddress) {
        coopToken = ERC20(contractAddress);
        priceFeed = AggregatorV3Interface(
            0x9326BFA02ADD2366b30bacB125260Af641031331
        );
    }

    /* Events
     */

    event NewMember(address sender, uint256 amount);
    event DepositFruits(address cooperant, uint256 kilograms);
    event TransferMade(
        string message,
        uint256 _inEth,
        string messageTwo,
        uint256 _inEthSecond
    );
    event NotEnoughGoods(string message);

    /* Modifiers
     */

    modifier onlyMembers() {
        require(
            cooperants[msg.sender].feePayed != 0,
            "Please become SmartCOOP member"
        );
        _;
    }

    modifier onlyNewMembers() {
        require(
            cooperants[msg.sender].feePayed == 0,
            "You already pay mebership fee"
        );
        _;
    }

    modifier minimumFee() {
        require(msg.value >= 1000, "Yearly fee is minimum 1000 wei");
        _;
    }

    /* Functions
     */

    fallback() external {
        revert();
    }

    function pause() public onlyOwner {
        _pause();
    }

    function unpause() public onlyOwner {
        _unpause();
    }

    function getLatestPrice() public view returns (int256) {
        (, int256 price, , , ) = priceFeed.latestRoundData();
        return (price * 10000000000);
    }

    function getConversationRate(uint256 ethAmount)
        public
        view
        returns (uint256)
    {
        uint256 ethPrice = uint256(getLatestPrice());
        uint256 ethAmountInUSD = (ethPrice * ethAmount) / (10**18);
        return ethAmountInUSD;
    }

    // WIDROW FUNCTION
    function withdraw() public onlyOwner returns (bool) {
        (bool sent, ) = owner().call{value: address(this).balance}("");
        require(sent, "Failed to send Ether");
        for (
            uint256 membersIndex = 0;
            membersIndex < members.length;
            membersIndex++
        ) {
            address memberAddress = members[membersIndex];
            cooperants[memberAddress].feePayed = 0;
        }
        members = new address[](0);
        return true;
    }

    function becomeCoopMember()
        public
        payable
        whenNotPaused
        onlyNewMembers
        minimumFee
        returns (bool)
    {
        cooperants[msg.sender].feePayed += msg.value;
        members.push(msg.sender);
        emit NewMember(msg.sender, msg.value);
        return true;
    }

    function depositFruitsToCOOP(uint256 _kg)
        public
        whenNotPaused
        onlyMembers
        returns (bool)
    {
        cooperants[msg.sender].kg += _kg;
        warehouseStock.push(msg.sender);
        coopTokenTransferTo(_kg * (10**18));
        emit DepositFruits(msg.sender, _kg);
        return true;
    }

    function getUserAccountBalance(address _salje)
        public
        view
        returns (
            uint256,
            uint256,
            uint256
        )
    {
        return (
            cooperants[_salje].feePayed,
            cooperants[_salje].kg,
            coopToken.balanceOf(_salje) / (10**18)
        );
    }

    function coopTokenTransferTo(uint256 _kg) private returns (bool) {
        address receiver = msg.sender;
        return coopToken.transfer(receiver, _kg);
    }

    function coopTokenTransferFrom(uint256 _kg)
        private
        onlyMembers
        returns (bool)
    {
        address sender = msg.sender;
        return coopToken.transferFrom(sender, msg.sender, _kg);
    }

    function bid(uint256 _amount) public payable returns (bool) {
        uint256 ethPriceUsd = uint256(getLatestPrice());

        for (
            uint256 warehouseStockIndex = 0;
            warehouseStockIndex < warehouseStock.length;
            warehouseStockIndex++
        ) {
            address inStockCooperantAddress = warehouseStock[
                warehouseStockIndex
            ];
            if (cooperants[inStockCooperantAddress].kg <= _amount) {
                uint256 totalPriceInUsd = cooperants[inStockCooperantAddress]
                    .kg * raspberryPrice;
                uint256 priceInWei = (ethPriceUsd /
                    (totalPriceInUsd * (10**18)));

                uint256 transfertToCoop = priceInWei;
                uint256 transferToProducer = priceInWei - transfertToCoop;

                (bool sentCoop, ) = payable(address(this)).call{
                    value: transfertToCoop
                }("");
                require(sentCoop, "Failed to send Ether");

                (bool sentProducer, ) = payable(inStockCooperantAddress).call{
                    value: transferToProducer
                }("");
                require(sentProducer, "Failed to send Ether");

                _amount - cooperants[inStockCooperantAddress].kg;
                cooperants[inStockCooperantAddress].kg = 0;

                emit TransferMade(
                    "To your account was transfered",
                    transferToProducer,
                    "And on COOP account",
                    transfertToCoop
                );
            } else if (cooperants[inStockCooperantAddress].kg >= _amount) {
                cooperants[inStockCooperantAddress].kg -= _amount;

                uint256 totalPriceInUsd = _amount * raspberryPrice;
                uint256 priceInEth = totalPriceInUsd / (ethPriceUsd / (10**18));

                uint256 transfertToCoop = priceInEth / 20;
                uint256 transferToProducer = priceInEth - transfertToCoop;

                (bool sentCoop, ) = payable(address(this)).call{
                    value: transfertToCoop
                }("");
                require(sentCoop, "Failed to send Ether");

                (bool sentProducer, ) = payable(inStockCooperantAddress).call{
                    value: transferToProducer
                }("");
                require(sentProducer, "Failed to send Ether");

                _amount - cooperants[inStockCooperantAddress].kg;
                cooperants[inStockCooperantAddress].kg = 0;

                emit TransferMade(
                    "To your account was transfered",
                    transferToProducer,
                    "And on COOP account",
                    transfertToCoop
                );
            } else {
                emit NotEnoughGoods(
                    "There si no enough raspberries in warhouse"
                );
            }
        }
        return true;
    }
}
